import * as React from 'react';
import {Link} from "react-router-dom";
import './sidenav.css';

export function SideNav() {
    return (
        <div>
            <ul>
                {menuElements.map((element, index) => (
                    <li key={index}>
                        <a href={element.path}>{element.title}</a>
                    </li>
                ))}
            </ul>



        </div>
    );
}
